window.bookSummaryJSON = "<p>Is your life a series of unfinished tasks and intentions? That stops now. <i>Finish What You Start </i>is a unique deep dive into the psychology and science of accomplishment, productivity, and getting things done. It discusses why we are sometimes stuck and gives detailed, step-by-step solutions you can start using today. Every phase of finishing and following through is covered, and even productivity pros will be able to learn something new.</p> <p>Following through and finishing what you started are valuable instructions you need more than you realize. It is combination of traits that enables you to create the life you want without having to compromise or wait. The alternative is a status quo that you’re stuck in.</p> <p>This guide includes practical tactics to grow your willpower, stop procrastination, focus like a laser, and achieve whatever you set your mind to. Above all else, this is a guide to better understanding your brain and instincts for optimal results. </p> <p>It discusses how to:</p> <p><i>Channel massive productivity and mental toughness</i></p> <p><i>Resist distractions, de-motivation, temptations, laziness, and excuses: </i></p> <p></p> <ul> <li>The surprising motivations that push us past obstacles</li> <li>How daily rules and a manifesto can help you achieve</li> <li>Valuable and insightful mindsets to view productivity from entirely new lights </li> </ul> <p><i>Seize self-control and finally accomplish your big and small goals</i></p> <p></p> <ul> <li>The science and tactics to beating procrastination easily</li> <li>Focus and willpower pitfalls you are probably committing at this very moment</li> <li>How to beat distractions, remain focused, stay on task, and get to what matters consistently </li> </ul> <p><i>Transform your life through productive habits and avoiding mental traps</i></p> <p>Peter Hollins has studied psychology and peak human performance for over 12 years and is a best-selling author. He has worked with dozens of individuals to unlock their potential and path towards success. His work draws on his academic, coaching, and research experience. </p>"; 
